(window.webpackJsonp=window.webpackJsonp||[]).push([[209],{562:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1165-kieu-ngao-truong-cuu-tieu"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1165-kieu-ngao-truong-cuu-tieu"}},[n._v("#")]),n._v(" Chương 1165: Kiêu ngạo Trương Cửu Tiêu")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("br"),t("br"),n._v("Trước mắt bức tranh, nếu không nhìn kỹ, thật giống như sơn thủy đứng sừng sững ở cửa sổ, khoảng cách hơi xa, lại có thể thấy rõ ràng, Minh Lý Chi Nhãn rút ngắn khoảng cách, trên ngọn núi tỉ mỉ chút xíu tất hiện, thậm chí đều có thể nhìn thấy mỗi cái lá cây gân lá."),t("br"),t("br"),n._v("“Cùng thật đồng dạng!”"),t("br"),t("br"),n._v("Trương Huyền khiếp sợ."),t("br"),t("br"),n._v("Cho dù là hắn, xem xét tỉ mỉ, bức họa này, vẫn như cũ cùng thật, quả thực thật là đáng sợ, nếu như treo trên tường, tuyệt đối sẽ không cảm thấy là một bức họa, mà sẽ tưởng rằng một cái chân thực tồn tại cửa sổ."),t("br"),t("br"),n._v("“Có thể bức họa này... Không có phong ấn a?”"),t("br"),t("br"),n._v("Minh Lý Chi Nhãn tại trên bức họa quay một vòng, Trương Huyền cau mày."),t("br"),t("br"),n._v("Đối phương nói, phía trên này có phong ấn, có thể cho dù hắn thi triển ra Minh Lý Chi Nhãn, đều không có nhìn ra ở nơi nào."),t("br"),t("br"),n._v("“Nhìn tới, thực lực của ta còn là quá thấp, xem thấu thất cảnh bức tranh, không có cái gì vấn đề, bát cảnh... Còn là khó mà làm được!”"),t("br"),t("br"),n._v("Lắc đầu."),t("br"),t("br"),n._v("Minh Lý Chi Nhãn cứ việc đi qua bốn lần trời nhận danh sư, liên tục tấn cấp, nhưng làm gì được nó hắn thực lực bản thân, quá yếu, chỉ có Thánh vực nhị trọng."),t("br"),t("br"),n._v("Bát cảnh tác phẩm hội họa, liên lụy đến Xuất Khiếu cảnh cường giả mới có thể thi triển lực lượng linh hồn, cho dù Minh Lý Chi Nhãn đặc thù, cũng nhìn không ra như thế về sau."),t("br"),t("br"),n._v("“Bức họa này có phong ấn?”"),t("br"),t("br"),n._v("“Như vậy sinh động như thật, đã ẩn chứa như thật như ảo chân lý, thật muốn có phong ấn... Muốn phong ấn cái gì?”"),t("br"),t("br"),n._v("“Không biết, có điều, đối phương đã lấy ra trân quý như thế tác phẩm hội họa, đến đây hỏi thăm, nhất định là phát hiện cái gì!”"),t("br"),t("br"),n._v("..."),t("br"),t("br"),n._v("Trương Huyền không nhìn ra, bên trong căn phòng mọi người, cũng nguyên một đám nhíu mày, thấp giọng, mỗi người thảo luận, dường như cũng không nhìn ra."),t("br"),t("br"),n._v("“Ta có thể hay không tới gần quan sát?”"),t("br"),t("br"),n._v("Có chút không hiểu, Mục hội trưởng đứng dậy, nói."),t("br"),t("br"),n._v("“Tùy ý!” Mặt nạ đồng xanh thanh âm không có bất kỳ biến hóa nào."),t("br"),t("br"),n._v("“Đa tạ!”"),t("br"),t("br"),n._v("Cũng không nhiều lời, hai bước đi tới trước mặt, Mục hội trưởng lấy ra một cái phóng đại dùng thủy tinh cầu, một chút xíu nhìn sang."),t("br"),t("br"),n._v("Thuật nghiệp hữu chuyên công, hắn là ở đây lợi hại nhất giám bảo sư, thấy hắn quan sát, mọi người tất cả đều đè lại hô hấp, sợ quấy rầy."),t("br"),t("br"),n._v("Sau một lúc lâu."),t("br"),t("br"),n._v("Mục hội trưởng mang theo nghi ngờ nhìn lại: “Bằng hữu, ngươi có thể hay không nói rõ chi tiết thoáng cái, cái gọi là phong ấn, đến cùng ở nơi nào, lại là loại nào hình thức? Như vậy, mọi người cũng không cần đoán tới đoán đi, trực tiếp nghĩ biện pháp phá giải!”"),t("br"),t("br"),n._v("“Mục hội trưởng cũng không nhìn ra?”"),t("br"),t("br"),n._v("Nghe nói như thế, mặt nạ đồng xanh thanh âm bên trong, lộ ra vẻ thất vọng."),t("br"),t("br"),n._v("Liền phong ấn cũng nhìn không ra, lại như thế nào phá giải?"),t("br"),t("br"),n._v("“Ta đến xem thoáng cái!”"),t("br"),t("br"),n._v("Vừa rồi thư họa sư công hội hội trưởng, cũng đứng dậy, đi tới trước mặt, cúi đầu nhìn sang."),t("br"),t("br"),n._v("Thư họa sư giám định phương thức, cùng giám bảo sư không giống, lấy ra cũng không phải là thủy tinh cầu, mà là một nhánh làm cái gì bút, trên không trung múa, tựa như lăng không thư hoạ."),t("br"),t("br"),n._v("“Hắn đây là thông qua phân tích tác phẩm hội họa vẽ tranh phương thức, tới phỏng đoán thư hoạ người tình cảm...” Gặp Trương Huyền không hiểu, Ngô sư truyền âm tới."),t("br"),t("br"),n._v("“Ừm!” Trương Huyền gật đầu."),t("br"),t("br"),n._v("Thật ra thì cái này cùng viết phỏng theo có chút tương tự."),t("br"),t("br"),n._v("Viết phỏng theo lâu, tự nhiên mà vậy liền sẽ biết sáng tác người trút xuống tâm huyết, nếu quả thật có phong ấn, hẳn là cũng có thể phát hiện."),t("br"),t("br"),n._v("Viết phỏng theo chỉ chốc lát, thư họa sư công hội hội trưởng, lông mày càng nhăn càng chặt, nhìn lại: “Bức họa này, nước chảy mây trôi, một mạch mà thành, không có chút nào ngăn cản, ta cũng cảm thấy không có phong ấn... Nếu quả thật nếu như mà có, tuyệt đối không thể như vậy trôi chảy...”"),t("br"),t("br"),n._v("“Không có phong ấn, ta liền sẽ không tiêu tốn như vậy đánh đổi, đến đây tìm kiếm các vị... Các ngươi chẳng lẽ cho là ta là rảnh rỗi nhàm chán, còn là cố ý tới giải trí?”"),t("br"),t("br"),n._v("Gặp thư họa sư công hội hội trưởng cũng nói như vậy, mặt nạ đồng xanh lắc lắc cánh tay, thanh âm bên trong tràn đầy không vui."),t("br"),t("br"),n._v("Còn tưởng rằng, ở đây đều là Thanh Nguyên thành mỗi cái chức nghiệp đỉnh phong nhất nhân vật, có thể một cái nhìn ra tác phẩm hội họa không giống bình thường, hiện tại xem ra, suy nghĩ nhiều..."),t("br"),t("br"),n._v("Bát cảnh tác phẩm hội họa, đã vượt ra khỏi Thanh Nguyên đế quốc có thể đã hiểu phạm trù."),t("br"),t("br"),n._v("“Ta tới đi!”"),t("br"),t("br"),n._v("Ngô sư đứng dậy, đi tới."),t("br"),t("br"),n._v("Thời gian không dài, lắc đầu, lui về tại chỗ."),t("br"),t("br"),n._v("Lấy nhãn lực của hắn, cũng chỉ nhìn ra, bức họa này trân quý bất phàm, lại không nhìn ra cái gọi là phong ấn tại nơi nào."),t("br"),t("br"),n._v("Rất nhanh, mọi người ở đây, đều nhìn một lần, tất cả đều lắc đầu."),t("br"),t("br"),n._v("“Tốt rồi, vị bằng hữu này, ngươi cũng đừng thừa nước đục thả câu, chúng ta nhìn không ra phong ấn tại đâu, nhưng bằng mượn nhiều người như vậy lực lượng, liên thủ phá vỡ, vẫn là có khả năng! Đến cùng là cái gì phong ấn, tại loại địa phương nào, cứ việc nói thẳng đi!”"),t("br"),t("br"),n._v("Thấy mọi người tất cả đều một mặt chán nản, Mục hội trưởng xua tay."),t("br"),t("br"),n._v("Cái này cái gọi là phong ấn, khả năng cần nghiên cứu rất lâu, mới có thể tìm được dấu vết để lại, cùng hắn lãng phí thời gian, còn không bằng trực tiếp làm cho đối phương nói ra, mọi người cũng có thể làm theo y chang, không đến mức như vậy phiền phức."),t("br"),t("br"),n._v("“Tốt a...”"),t("br"),t("br"),n._v("Gặp tất cả mọi người không nhìn ra, mặt nạ đồng xanh trong mắt thất vọng càng đậm, có điều, đoán chừng cũng quả thực không có những biện pháp khác, đành phải nhẹ gật đầu, một chỉ núi ở giữa bao phủ mây mù."),t("br"),t("br"),n._v("“Phong ấn ngay tại cái này trong mây mù! Nếu như đoán không sai, mây mù phía dưới vẫn như cũ là tranh, hơn nữa liên lụy đến cái gì bí tịch, đáng tiếc liền là không nhìn thấy, đi không hết...” Mặt nạ đồng xanh lắc đầu."),t("br"),t("br"),n._v("“Mây mù?” Mọi người đồng loạt nhìn sang."),t("br"),t("br"),n._v("Trên bức họa sơn mạch, cao vút trong mây, giữa sườn núi vị trí, có một đám mây trắng bao phủ, che đậy gần phân nửa sơn mạch, sinh động như thật, tựa như sẽ di động, vốn cho rằng chỉ là trang trí, lại là phong ấn?"),t("br"),t("br"),n._v("Trương Huyền cũng kỳ quái nhìn sang, Minh Lý Chi Nhãn chiếu xuống, tác phẩm hội họa bên trên mây trắng, chậm rãi chảy xuôi, tựa như tự nhiên hình thành đồng dạng, cho người ta một loại ẩn chứa hơi nước thoải mái cảm giác, mảy may nhìn không ra bất luận cái gì đặc thù."),t("br"),t("br"),n._v("“Ngươi sao có thể xác định, mây trắng này là phong ấn?”"),t("br"),n._v(" Nhìn một hồi, thư họa sư công hội hội trưởng, nhịn không được mở miệng."),t("br"),t("br"),n._v("Mọi người cũng đồng loạt nhìn lại."),t("br"),t("br"),n._v("“Lấy cái bó đuốc tới!”"),t("br"),t("br"),n._v("Lắc đầu, mặt nạ đồng xanh quay đầu phân phó."),t("br"),t("br"),n._v("Canh giữ ở cửa ra vào một cái giám bảo sư nhẹ gật đầu, lui ra ngoài, thời gian không dài, mang tới một cái bó đuốc."),t("br"),t("br"),n._v("Tiện tay nhận lấy, mặt nạ đồng xanh cầm tới tác phẩm hội họa trước mặt, nhẹ nhàng một nướng, tại ánh lửa chiếu rọi, toàn bộ sơn mạch, lập tức biến sắc, theo trước đó xanh biếc, biến thành xám đậm, chỉ có mây trắng không có bất kỳ biến hóa nào."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Thư họa sư công hội hội trưởng con ngươi co rụt lại: “Mây trắng không có biến hóa, nói rõ... Cũng không phải là cùng thời kỳ làm tranh, cả hai chênh lệch ít nhất ba mươi năm trở lên... Ta vừa rồi thế mà không nhìn ra...”"),t("br"),t("br"),n._v("Dựa theo tình huống bình thường, nếu như là một mạch mà thành, hẳn là cả bức họa đều sẽ biến màu sắc mới đúng, hiện tại mây trắng không có xuất hiện biến hóa, quả thực cùng đối phương nói đồng dạng, là đằng sau vẽ lên đi, hẳn là thuộc về phong ấn loại đồ vật."),t("br"),t("br"),n._v("“Cả hai có thể hoàn chỉnh kết hợp, để chúng ta nhìn không ra, hẳn là cùng một người vẽ, hơn nữa... Tranh mây trắng thời điểm, bút lực lần nữa tăng thêm, mới có thể cùng nguyên tranh phù hợp tốt như vậy, ai cũng khó mà phát hiện...”"),t("br"),t("br"),n._v("Mục hội trưởng chen vào nói."),t("br"),t("br"),n._v("Mọi người gật đầu."),t("br"),t("br"),n._v("Cũng chỉ có cùng một người vẽ tranh, mới có thể để cho một đám cao thủ, đều không có phát giác."),t("br"),t("br"),n._v("“Thế nhưng là... Cho dù biết phong ấn, quả thực cũng không có cách nào mở ra...”"),t("br"),t("br"),n._v("Cảm khái xong, mọi người trầm mặc."),t("br"),t("br"),n._v("Biết mây trắng là về sau thêm, có thể là phong ấn, nhưng cả hai hoàn mỹ dung hợp, căn bản là không mở được."),t("br"),t("br"),n._v("“Ai, xem ra ta vẫn là quá cao đánh giá Thanh Nguyên đế quốc...”"),t("br"),t("br"),n._v("Gặp nói ra phong ấn, tất cả mọi người bó tay toàn tập, mặt nạ đồng xanh lắc đầu, than thở một tiếng, đang định đem tác phẩm hội họa thu hồi, liền nghe đến một cái thanh âm nhàn nhạt vang lên."),t("br"),t("br"),n._v("“Ta có thể hay không nhìn một chút?”"),t("br"),t("br"),n._v("Ngẩng đầu nhìn lại, chỉ thấy một thanh niên đứng người lên đi tới."),t("br"),t("br"),n._v("Chính là Trương Huyền."),t("br"),t("br"),n._v("Đối với bức họa này, hắn cũng có chút khó hiểu, đã mọi người nhìn không ra, hắn muốn xác định thoáng cái."),t("br"),t("br"),n._v("“Ngươi chẳng qua một cái ngũ tinh giám bảo sư thôi, có thể nhìn ra cái gì? Vẫn là ta tới đi!”"),t("br"),t("br"),n._v("Còn chưa đi đến trước mặt, sau lưng một thanh âm vang lên, Trương Cửu Tiêu một mặt ngạo nghễ đi tới."),t("br"),t("br"),n._v("Đi tới trước mặt, Trương Cửu Tiêu duỗi ra ngón tay đang vẽ cuốn lên nhẹ nhàng vạch một cái: “Loại này bát cảnh tác phẩm hội họa, ta trước kia nhìn thấy qua, biết loại này phong ấn sử dụng phương thức.”"),t("br"),t("br"),n._v("“Nhìn thấy qua? Còn xin nói rõ, nếu như có thể mở ra, ta bằng lòng hậu lễ dâng tặng!”"),t("br"),t("br"),n._v("Gặp trước mắt vị này tự tin như vậy, mặt nạ đồng xanh dừng bước, xoay người nói."),t("br"),t("br"),n._v("“Loại này phong ấn, kêu Phong Vân khấu! Là dùng lấp mực phương thức, đem lên một tầng che chắn, lại không thương tổn căn bản, nếu như đoán không sai, trong đó gia nhập đặc thù linh tính, nếu không, thời gian dài tất nhiên sẽ hoàn toàn dung hợp...”"),t("br"),t("br"),n._v("Trương Cửu Tiêu đầu lâu nâng lên."),t("br"),t("br"),n._v("“Phong Vân khấu?”"),t("br"),t("br"),n._v("Mặt nạ đồng xanh cùng mọi người tất cả đều nghi ngờ nhìn lại."),t("br"),t("br"),n._v("Rất hiển nhiên, chưa hề có người nghe qua thuyết pháp này."),t("br"),t("br"),n._v("“Tại hạ ở gia tộc, từng thấy tận mắt có người mở ra qua loại này phong ấn, bởi vậy, biết như thế nào giải quyết!”"),t("br"),t("br"),n._v("Hai tay chắp sau lưng, Trương Cửu Tiêu mang theo một loại vẻ ngạo nhiên."),t("br"),t("br"),n._v("“Gia tộc?”"),t("br"),t("br"),n._v("“Ngươi không biết? Chúng ta vị này Thanh Nguyên thành đệ nhất thiên tài, nhưng thật ra là Thánh Nhân Trương gia hậu bối!”"),t("br"),t("br"),n._v("“Thánh Nhân Trương gia?”"),t("br"),t("br"),n._v("“Khó trách, loại này thân thế, dù chỉ là chi thứ, kiến thức cũng không phải chúng ta có thể so sánh...”"),t("br"),t("br"),n._v("..."),t("br"),t("br"),n._v("Nghe được hắn có phương pháp giải quyết, mọi người một hồi xôn xao, nguyên một đám lộ ra bội phục chi sắc."),t("br"),t("br"),n._v("“Như thế nào giải quyết?”"),t("br"),t("br"),n._v("Nghe hắn đến từ Thánh Nhân Trương gia, mặt nạ đồng xanh trên mặt lộ ra vẻ mặt ngưng trọng, ôm quyền hỏi."),t("br"),t("br"),n._v("“Rất đơn giản, muốn đem cái này phong ấn loại bỏ, tìm một cái am hiểu linh hồn người, lấy linh hồn vì kiều bản, đem bên trong ẩn chứa linh tính, hấp dẫn ra tới...”"),t("br"),t("br"),n._v("“Am hiểu linh hồn người?”"),t("br"),t("br"),n._v("Mặt nạ đồng xanh nghi ngờ."),t("br"),t("br"),n._v("“Không sai, linh hồn lan tràn trong đó, đem đặt ở trung tâm linh tính rút ra, mất đệm tầng, phong ấn tự nhiên mà vậy cũng liền tiêu tán...”"),t("br"),t("br"),n._v("Trương Cửu Tiêu nói."),t("br"),t("br"),n._v("Mặt nạ đồng xanh chần chừ: “Không biết ngươi nói vị này am hiểu linh hồn, muốn đạt tới cấp bậc gì?”"),t("br"),t("br"),n._v("“Cần linh hồn, khống chế chính xác như phát, hơn nữa lại không thể quá mạnh, nếu không, sẽ hư hại bức tranh, để bát cảnh tác phẩm hội họa biến thành phế phẩm, đương nhiên trọng yếu nhất chính là, người này nhất định phải biết linh tính ở nơi nào, đối thư hoạ vô cùng hiểu rõ mới được!”"),t("br"),t("br"),n._v("“Cái này...” Mặt nạ đồng xanh sửng sốt một chút, mày nhăn lại: “Loại người này... Nơi nào mới có thể tìm đến?”"),t("br"),t("br"),n._v("Đối phương nói yêu cầu mặc dù không nhiều, nhưng có thể làm được, toàn bộ Thanh Nguyên thành, chỉ sợ đều không có."),t("br"),t("br"),n._v("“Không cần tìm...”"),t("br"),t("br"),n._v("Nhẹ nhàng cười một tiếng, Trương Cửu Tiêu sống lưng thẳng đứng, tựa như giáo, cho người ta một loại chọc nước bùn mà không nhiễm, rửa sạch sóng gợn mà không yêu cảm giác, lộ ra một cỗ ngạo nghễ ngoài ta còn ai khí tức."),t("br"),t("br"),n._v("“Tại hạ bất tài, vừa vặn phù hợp!”"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1173"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1175"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);